import { Link } from "react-router-dom";

function Navbar() {
  return (
    <nav style={{ padding: "1rem", background: "#1e1e1e", display: "flex", justifyContent: "center", gap: "1rem" }}>
      <Link to="/" style={{ color: "#ffd700", textDecoration: "none" }}>Home</Link>
      <Link to="/tools/pdf" style={{ color: "#fff", textDecoration: "none" }}>PDF Tools</Link>
      <Link to="/tools/image" style={{ color: "#fff", textDecoration: "none" }}>Image Tools</Link>
      <Link to="/about" style={{ color: "#fff", textDecoration: "none" }}>About</Link>
      <Link to="/contact" style={{ color: "#fff", textDecoration: "none" }}>Contact</Link>
    </nav>
  );
}

export default Navbar;
